export class GeneralTimeTables extends React.Component{
    constructor(props) {
        super(props);
        let id = this.getRouteId(window.location.href)
        this.state = {
            routeId : id
        }
    }

    getRouteId(url){
        let id = url.lastIndexOf('=')
